  KEY `idx_jobs_end_date` (`end_date` DESC),
  CONSTRAINT `fk_faculty_id_1` FOREIGN KEY (`faculty_id`) REFERENCES `faculty` (`faculty_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
