INSERT INTO `job` VALUES (101,'ADH','To mentor and teach the course EE333 - Power Electronics for academically weak and needy students at the Hostel Premises as ADH mentors. The mentor should meet the students regularly, conduct sessions to clear doubts, and develop problem-solving skills.','7.8','Good grade in EE333-Power Electronics','Enrollment in EE333-Power Electronics course',NULL,175,2,'2024-01-01','2024-04-01',91,1012,'no','2023-12-31'),(102,'other','Event Coordinator for the Annual Cultural Fest. The coordinator will be responsible for planning, organizing, and executing various cultural events during the fest.','7.9','Good communication skills','Event management experience preferred','Candidates with previous event management experience will be given priority.',200,2,'2024-01-10','2024-04-10',91,1001,'no','2023-12-31'),(103,'ADH','Programming Mentor for CS205 - Data Structures. The mentor will assist students in understanding data structures concepts and help them with Python programming assignments.','8.0','Excellent programming skills in Python','Enrollment in CS205-Data Structures course, Proficiency in Python programming','Experience in tutoring or mentoring programming courses is a plus.',190,3,'2024-01-05','2024-04-05',91,1038,'no','2023-12-31'),(104,'other','Public Speaking Coach for Debating Club. The coach will train students in public speaking techniques, help them prepare for debates, and guide them in improving communication skills.','7.6','Experience in public speaking','Interest in public speaking and debate','Certification in public speaking or debate coaching is a plus.',185,2,'2024-01-25','2024-04-25',91,1013,'yes','2023-12-31'),(105,'other','Event Planner for College Sports Meet. The planner will coordinate logistics, schedule events, and ensure smooth execution of the sports meet activities.','7.8','Good organizational skills','Event planning experience preferred','Candidates with sports management background will be given priority.',175,3,'2024-02-01','2024-05-01',90,1015,'no','2024-01-31'),(106,'other','Digital Marketing Mentor for Business School. The mentor will guide students in understanding digital marketing strategies, conducting marketing research, and developing marketing campaigns.','7.7','Experience in digital marketing','Interest in marketing, Basic knowledge of digital marketing concepts','Certification in digital marketing is a plus.',195,2,'2024-02-10','2024-05-10',90,1027,'yes','2024-01-31'),(107,'other','Photography Coordinator for College Magazine. The coordinator will manage photography assignments, coordinate with photographers, and ensure high-quality visual content for the magazine.','7.5','Experience in photography','Photography skills, Own camera equipment','Previous experience in college magazine photography preferred.',150,2,'2024-02-15','2024-05-15',90,1044,'no','2024-01-31'),(108,'other','Writing Mentor for English Literature Department. The mentor will assist students in improving writing skills, provide feedback on essays, and organize writing workshops.','7.9','Excellent writing skills','Enrollment in English literature courses','Experience in creative writing or academic writing is preferred.',190,3,'2024-02-20','2024-05-20',90,1039,'yes','2024-01-31'),(109,'other','Graphic Designer for College Marketing Team. The designer will create visually appealing graphics for promotional materials, social media posts, and marketing campaigns.','7.8','Graphic design skills','Proficiency in graphic design software','Portfolio showcasing previous design work is required.',175,3,'2024-03-01','2024-06-01',92,1002,'no','2024-02-28'),(110,'other','Robotics Mentor for Engineering Department. The mentor will guide students in robotics projects, conduct workshops, and assist in organizing robotics competitions.','7.6','Experience in robotics','Enrollment in robotics courses, Proficiency in programming (e.g., C++)','Previous experience in robotics projects is preferred.',195,2,'2024-03-05','2024-06-05',92,1040,'yes','2024-02-28'),(111,'other','Web Developer for College Website Revamp Project. The developer will contribute to redesigning and improving the college website, ensuring a user-friendly experience.','7.9','Knowledge of web development','Proficiency in web development technologies (HTML, CSS, JavaScript)','Previous experience in website development is desirable.',185,3,'2024-03-15','2024-06-15',92,1016,'no','2024-02-28'),(112,'other','Psychology Research Mentor for Experimental Psychology Course. The mentor will guide students in designing and conducting psychological experiments, analyze data, and assist in research projects.','7.8','Experience in psychology research','Enrollment in psychology courses, Knowledge of research methods','Previous experience in psychology research is preferred.',190,2,'2024-03-20','2024-06-20',92,1035,'yes','2024-02-28'),(113,'other','Alumni Relations Coordinator for College. The coordinator will establish and maintain relationships with alumni, organize alumni events, and facilitate networking opportunities for current students.','7.7','Good communication and networking skills','Networking skills, Excellent communication skills','Previous experience in alumni relations or event planning is preferred.',175,2,'2024-04-01','2024-07-01',91,1018,'no','2024-03-31'),(114,'other','Environmental Awareness Mentor for Green Campus Initiative. The mentor will raise awareness about environmental issues, organize eco-friendly events, and encourage sustainable practices on campus.','7.9','Experience in environmental activism','Passion for environmental sustainability','Previous involvement in environmental activism is preferred.',195,3,'2024-04-05','2024-07-05',91,1022,'yes','2024-03-31'),(115,'other','Event Manager for College Annual Day Celebration. The manager will coordinate all aspects of the annual day celebration, including cultural performances, guest lectures, and awards ceremonies.','7.6','Experience in event management','Event management experience','Excellent organizational and multitasking skills are required.',190,3,'2024-04-15','2024-07-15',91,1033,'no','2024-03-31'),(116,'other','Journalism Mentor for College News Club. The mentor will guide students in news reporting, writing articles, and editing news content for the college newsletter.','7.8','Experience in journalism','Interest in journalism, Strong writing skills','Previous experience in journalism or writing is preferred.',185,2,'2024-04-20','2024-07-20',91,1042,'yes','2024-03-31'),(117,'other','Data Analyst for College Analytics Project. The analyst will work on analyzing college data, generating reports, and providing insights to support decision-making.','7.9','Knowledge of data analysis tools','Proficiency in data analysis tools (e.g., Excel, Tableau)','Previous experience in data analysis is preferred.',175,2,'2024-05-01','2024-08-01',92,1003,'no','2024-04-30'),(118,'other','Software Development Mentor for Programming Club. The mentor will guide students in software development projects, conduct coding sessions, and assist in organizing hackathons.','8.0','Experience in software development','Enrollment in programming courses, Proficiency in programming languages (e.g., Java, Python)','Previous experience in software development is preferred.',190,3,'2024-05-05','2024-08-05',92,1019,'yes','2024-04-30'),(119,'other','Student Council President for College. The president will lead the student council, represent student interests, and collaborate with college administration on student-related matters.','7.5','Good organizational and leadership skills','Active involvement in student council activities','Leadership experience in student organizations is required.',175,3,'2024-05-15','2024-08-15',92,1007,'no','2024-04-30'),(120,'other','Social Media Coordinator for College Marketing Team. The coordinator will manage social media accounts, create engaging content, and implement social media marketing strategies.','7.7','Experience in social media management','Social media management skills','Previous experience in social media coordination or digital marketing is preferred.',185,2,'2024-05-20','2024-08-20',92,1024,'yes','2024-04-30'),(121,'PAL','PAL - English Communication Mentor. The mentor will assist students in improving English communication skills, providing guidance and support to help them overcome language barriers.','7.8','Good communication skills','Interest in mentoring, Proficiency in English language','Experience in teaching or language coaching is preferred.',175,10,'2024-04-30','2024-07-30',91,1006,'no','2024-04-29'),(122,'PAL','PAL - Computer Literacy Mentor. The mentor will provide guidance and assistance to students in developing basic computer skills, helping them navigate software applications and internet usage.','7.5','Basic computer skills','Interest in mentoring, Familiarity with computer usage','Experience in computer tutoring or training is preferred.',170,10,'2024-05-05','2024-08-05',92,1011,'no','2024-04-29'),(123,'other','Software Developer for Institute Building Project. The developer will contribute to software development projects related to institute building initiatives, collaborating with the project team to meet project requirements.','8.0','Proficiency in software development','Experience in software development, Knowledge of relevant technologies','Previous experience in large-scale project development is preferred.',200,2,'2024-03-01','2024-06-01',92,1029,'no','2024-02-14'),(124,'other','Research Assistant for Engineering Faculty. The assistant will work under the supervision of engineering faculty, assisting in research tasks, data collection, and experimental work.','7.7','Enrollment in engineering program','Enrollment in engineering program','Interest in research and engineering projects is required.',180,3,'2024-02-15','2024-05-15',90,1037,'yes','2024-02-14'),(125,'ADH','To lead discussions on advanced topics in algorithms for CS421 - Algorithms course. The facilitator should have a deep understanding of algorithmic concepts and be able to guide students in solving complex problems.','9.5','At least A- in CS421-Algorithms','Enrollment in CS421 - Algorithms course',NULL,150,2,'2024-01-01','2024-04-01',91,1009,'no','2023-12-31'),(126,'ADH','To conduct regular study sessions for students enrolled in MA325 - Topology course. The instructor should have a strong background in advanced mathematical concepts and be able to assist students in understanding complex topics.','9.0','Good grade in MA325-Topology','Enrollment in MA325 - Topology course',NULL,180,2,'2024-01-01','2024-04-01',91,1014,'no','2023-12-31'),(127,'ADH','To lead workshops focused on problem-solving techniques for EE432 - Analog Circuits course. The leader should have expertise in Analog Circuits and be able to guide students in applying theoretical concepts to real-world problems.','8.5','At least A- in EE432-Analog Circuits','Enrollment in EE432 - Analog Circuits course',NULL,190,2,'2024-01-01','2024-04-01',91,1045,'no','2023-12-31'),(128,'ADH','To organize doubt sessions for students enrolled in CS510 - Compilers course. The organizer should have advanced programming skills and be able to design challenging problems for participants.','9.2','Good grade in CS510-Compilers','Enrollment in CS510 - Compilers course',NULL,170,2,'2024-01-01','2024-04-01',91,1028,'no','2023-12-31'),(130,'PAL','English German','CPI > 8.5','English German','English German','English German',150,1,'2024-04-05','2024-04-26',1,2001,'no','2024-04-12'),(131,'other','tester','test','test','test','test',12,2,'2024-04-01','2024-04-30',3,2001,'no','2024-04-10'),(132,'ADH','tester','test','test','test','test',12,2,'2024-04-01','2024-04-30',3,2001,'yes','2024-04-10');
